import { useState } from "react"
import "./SearchEmployee.css"

function SearchEmployee (props){
   const [term, setTerm] = useState("");
   const searchInputHanler = (event) => {
    setTerm(event.target.value);
  };
    return(
        <div className="search-container">
            <form class="example" action="action_page.php" onSubmit={props.submitFunc(term)}>
            <input type="text" placeholder="Search" className="search-input" onChange={searchInputHanler} />
            <button type="submit" className="search-button">Search</button>
            </form>
        </div>
    )
}

export default SearchEmployee
